  const init = () => {
  setLoading(true)
  //import api_key from env
    axios.get(`https://www.alphavantage.co/query?function=DIGITAL_CURRENCY_DAILY&symbol=BTC&market=CNY&apikey=${process.env.REACT_APP_API_KEY}`)
    .then(function(response){

        if(response.data["Note"]) {
            coinContext.dispatch({
                type: "SET_ERROR",
                payload: {
                    error: response.data["Note"] || "The system encountered a problem"
                }
            });
        } else {
            coinContext.dispatch({
                type: "SET_BTC",
                payload: {
                    btc: response.data,
                }
            });
        }
        setLoading(false);
    });  
  }

