//convert object to array -> object.entries returns an array of the objects property pairs. [key, value]
let euru = Object.entries(EURUSD["Time Series FX (Daily)"]);
let ujpy = Object.entries(USDJPY["Time Series FX (Daily)"]);
let gbpu = Object.entries(GBPUSD["Time Series FX (Daily)"]);
let ucad = Object.entries(USDCAD["Time Series FX (Daily)"]);
let usek = Object.entries(USDSEK["Time Series FX (Daily)"]);
let uchf = Object.entries(USDCHF["Time Series FX (Daily)"]);

//create arrays with dxy values
const euruPrice = euru.map(value => value[1]["1. open"])
const ujpyPrice = ujpy.map(value => value[1]["1. open"])
const gbpuPrice = gbpu.map(value => value[1]["1. open"])
const ucadPrice = ucad.map(value => value[1]["1. open"])
const usekPrice = usek.map(value => value[1]["1. open"])
const uchfPrice = uchf.map(value => value[1]["1. open"])

//get dates for chart
const dates = euru.map(value => value[0]).reverse();

//create empty dxy array
let DXY = [];

//create dxy formula calculation
for(let i = 0; i < 100; i++){
    DXY.push(50.14348112 * Math.pow(euruPrice[i],-0.576) * Math.pow(ujpyPrice[i], 0.136) * Math.pow(gbpuPrice[i], -0.119) * Math.pow(ucadPrice[i], 0.091) * Math.pow(usekPrice[i], 0.042) * Math.pow(uchfPrice[i], 0.036));
}


//initialise btc and error from context state
const {btc, error} = coinContext.state;

//if successfully loaded data push btc values to finalArr
if(!loading && error === ""){
  let coin = btc["Time Series (Digital Currency Daily)"];

  let arrayCoin = Object.entries(coin);
  let sliceArrayCoin = arrayCoin.slice(0,100);
  var finalArr = sliceArrayCoin.map(value => value[1]["1b. open (USD)"]).reverse();
}

